	add("crackle", "{\"term\":\"crackle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crack|le|gloss2\u003dearly modern English frequentative suffix|lang\u003den}}. The physics sense is part of a facetious sequence \u0026quot;snap, crackle, pop\u0026quot;, after the mascots of \u0027Rice Krispies\u0027 cereal.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fizzing, popping sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A style of glaze giving the impression of many small cracks\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fifth derivative of the position vector with respect to time (after velocity, acceleration, jerk, and jounce), i.e. the rate of change of jounce\", \"priority\":3}]}, \"synonyms\":{}}");

