	add("cradle", "{\"term\":\"cradle\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Old english (ca. 450-1100) \u0027cradol\u0027 from Proto-germanic {{m|gem-pro|*kradulaz}}, {{m|gem-pro|*krad(a)la-}}, from the Proto-germanic root {{m|gem-pro|*krad-}}. Cognates with cart.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A bed or cot for a baby, oscillating on rockers or swinging on pivots\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027cradle\u0027\u0027 that received thee at thy birt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"No sooner was I crept out of my \u0027\u0027cradle\u0027\u0027 / But I was made a king, at nine months old\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The place of origin, or in which anything is nurtured or protected in the earlier period of existence\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027cradle\u0027\u0027 of crime\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027cradle\u0027\u0027 of liberty\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Infancy, or very early life\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"from the \u0027\u0027cradle\u0027\u0027 to the grave\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"from their \u0027\u0027cradles\u0027\u0027 bred togethe\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Clarendo\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"a form of worship in which they had been educated from their \u0027\u0027cradles\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"An implement consisting of a broad scythe for cutting grain, with a set of long fingers parallel to the scythe, designed to receive the grain, and to lay it evenly in a swath\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A tool used in mezzotint engraving, which, by a rocking motion, raises burrs on the surface of the plate, so preparing the ground\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A framework of timbers, or iron bars, moving upon ways or rollers, used to support, lift, or carry ships or other vessels, heavy guns, etc., as up an inclined plane, or across a strip of land, or in launching a ship\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A case for a broken or dislocated limb\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A frame to keep the bedclothes from contact with the sensitive parts of an injured person\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"A machine on rockers, used in washing out auriferous earth\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A suspended scaffold used in shafts\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"A ribbing for vaulted ceilings and arches intended to be covered with plaster\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A basket or apparatus in which, when a line has been made fast to a wrecked ship from the shore, the people are brought off from the wreck\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cradle\u0027\u0027 was ill-made. One victim fell into the sea and was lost and the ensuing delay cost three more lives\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A rest for the receiver of a telephone, or for certain computer hardware\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"He slammed the handset into the \u0027\u0027cradle\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A hand position allowing a contact ball to be held steadily on the back of the hand\", \"priority\":27}]}, \"synonyms\":{}}");

