	add("craft", "{\"term\":\"craft\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"Dutch\", \"saterfriesisch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) \u0027cræft\u0027 (physical strength, might, courage, science, skill, art, ability, talent, virtue, excellence, trade, handicraft, calling, work or product of art, hex, trick, fraud, deceit, machine, instrument) from Proto-germanic {{m|gem-pro|*kraftaz||power}}, from Proto-indo-european {{m|ine-pro|*ger-||to turn, wind}}. Cognate with Saterfriesisch \u0027kraft\u0027 (strength) West frisian \u0027krêft\u0027 (strength) Dutch \u0027kracht\u0027 (strength, force, power) German \u0027kraft\u0027 (strength, force, power) Swedish \u0027kraft\u0027 (power, force, drive, energy) Icelandic \u0027kraftur\u0027 (power)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Strength; power; might\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ability; dexterity; skill, especially skill in making plans and carrying them into execution; dexterity in managing affairs; adroitness; practical cunning\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1572-1637\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A poem is the work of the poet; poesy is his skill or \u0027\u0027craft\u0027\u0027 of making\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1807-1882\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Since the birth of time, throughout all ages and nations, / Has the \u0027\u0027craft\u0027\u0027 of the smith been held in repute\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cunning, art, skill, or dexterity applied to bad purposes; artifice; guile; subtlety; shrewdness as demonstrated by being skilled in deception\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1588-1679\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"You have that crooked wisdom which is called \u0027\u0027craft\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"xiv.1\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The chief priests and the scribes sought how they might take him by \u0027\u0027craft\u0027\u0027, and put him to death\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A device; a means; an art; art in general\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The skilled practice of a practical occupation\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The members of a trade collectively; guild\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Implements used in catching fish, such as net, line, or hook. Modern use primarily in whaling, as in harpoons, hand-lances, etc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"“An Act for encouraging and regulating Fiſheries”, in \u0027Acts and Laws of the State of Connecticut, in America\u0027, T. Green (1784), [http://books.google.com/books?id\u003dywc4AAAAIAAJ\u0026amp;pg\u003dPA79\u0026amp;dq\u003dcraft p.79\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"And whereas the continual Interruption of the Courſe and Paſſage of the Fiſh up the Rivers, by the daily drawing of Seins and other Fiſh-\u0027\u0027Craft\u0027\u0027, tends to prevent their Increaſe,\u0027 \u0026lt;!-- [sic] italics --\u0026gt\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1869\u0027\u0027 April 27, C. M. Scammon, Edward D. Cope (editor), “On the Cetaceans of the Western Coast of North America”, in \u0027Proceedings of the Academy of Natural Sciences of Philadelphia\u0027, Volume 21, [http://books.google.com/books?id\u003d9IEOAQAAIAAJ\u0026amp;pg\u003dRA1-PA46\u0026amp;dq\u003dcraft p.46\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The whaling \u0027\u0027craft\u0027\u0027 consists of harpoons, lances, lines, and sealskin buoys, all of their own workmanship\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"“A Boy Who Went Whaling”, in \u0027The Highest Hit: and Other Selections by Newbery Authors\u0027,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dxZC5QKSqW8UC ]\u0026lt;/sup\u0026gt; Gareth Stevens Publishing (2001), ISBN 9780836828566, p.47\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"From the mate’s boat they removed, at his direction, all whaling gear and \u0027\u0027craft\u0027\u0027 except the oars and a single lance\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"1950\u0027\u0027, in \u0027Discovery Reports\u0027, Volume 26,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dGFgqAAAAMAAJ ]\u0026lt;/sup\u0026gt; Cambridge University Press, p.318\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Temple, a negro of New Bedford, who made ‘whalecraft’, that is, was a blacksmith engaged in working from iron the special utensils or ‘\u0027\u0027craft\u0027\u0027’ of the whaling trade\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027, Joan Druett, \u0027Petticoat Whalers: Whaling Wives at Sea, 1820–1920\u0027, University Press of New England (2001), ISBN 978-1-58465-159-8, [http://books.google.com/books?id\u003dlwfRQFIeBYMC\u0026amp;pg\u003dPA55\u0026amp;dq\u003dcraft p.55\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"The men raced about decks collecting the whaling \u0027\u0027craft\u0027\u0027 and gear and putting them into the boats, while all the time the lookouts hollered from above\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Boats, especially of smaller size than ships. Historically primarily applied to vessels engaged in loading or unloading of other vessels, as lighters, hoys, and barges\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A woman\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"“A tight little \u0027\u0027craft\u0027\u0027,” was Austin’s invariable comment on the matron; and she looked it, always trim and trig and smooth of surface like a converted yacht cleared for action\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"Those vessels attendant on a fleet, such as cutters, schooners, and gun-boats, generally commanded by lieutenants\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"A vehicle designed for navigation in or on water or air or through outer space\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"A particular kind of skilled work\", \"priority\":31}]}, \"synonyms\":{}}");

	add("crafter", "{\"term\":\"crafter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|craft|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who participates in a particular handicraft, either as a hobby or as a small busines\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"There are a number of \u0027\u0027crafters\u0027\u0027 around here who make quilts\", \"priority\":2}]}, \"synonyms\":{}}");

