	add("craftsman", "{\"term\":\"craftsman\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\u0027craft\u0027 {suffix||man|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A male artisan\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Plato, \u0027Sophist\u0027. Translation by Lesley Brown. w:Stephanus 232d\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And if someone wants to know how to make objections to actual \u0027\u0027craftsmen\u0027\u0027 themselves on the subject of art in general or any particular art, there are published treatises available, as you know\", \"priority\":3}]}, \"synonyms\":{}}");

