	add("craftsperson", "{\"term\":\"craftsperson\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|craft|person|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who is highly skilled at their trade; an artificer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A person who produces arts and crafts\", \"priority\":2}]}, \"synonyms\":{}}");

	add("craftspersonship", "{\"term\":\"craftspersonship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|craftsperson|ship|lang\u003den}}, on the pattern of \u0027craftsmanship\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The body of activities, skills, techniques, knowledge, and expertise pertinent to (a) particular craft(s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1935\u0027\u0027: \u0027Arts Magazine\u0027, [http://www.google.co.uk/books?id\u003d6GpUAAAAMAAJ\u0026amp;q\u003dcraftspersonship\u0026amp;dq\u003dcraftspersonship\u0026amp;lr\u003d\u0026amp;ei\u003dBEKzSOS5DYXKzQSanZmnCA\u0026amp;pgis\u003d1 page 140] (Art Digest Inc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The carpenter’s role – like that of a story told 1900 years earlier – is not to craft, for in his \u0027\u0027craftspersonship\u0027\u0027 he is faulty, but to comprehend\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027: Stephen Gudeman, \u0027The Anthropology of Economy: Community, Market, and Culture\u0027, [http://www.google.co.uk/books?id\u003d1sF7LK9S-g0C\u0026amp;pg\u003dPA115\u0026amp;dq\u003dcraftspersonship\u0026amp;lr\u003d\u0026amp;ei\u003dBEKzSOS5DYXKzQSanZmnCA\u0026amp;sig\u003dACfU3U0hDklZephwgAIUPiFXgYcFYz2hQA page 115] ([http://www.blackwellpublishing.com/ Blackwell Publishing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This artisanship or \u0027\u0027craftspersonship\u0027\u0027 was the sort of Enlightenment activity extolled by Diderot in the eighteenth century\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027: John Henderson, \u0027The Medieval World of Isidore of Seville\u0027, [http://www.google.co.uk/books?id\u003d9HLo4C_x03sC\u0026amp;pg\u003dPA205\u0026amp;dq\u003dcraftspersonship\u0026amp;lr\u003d\u0026amp;ei\u003d0Ya0SInUCpWKyQTozNG0Dw\u0026amp;sig\u003dACfU3U090Pmn4b-FMlUdPYEFchFeQlgA7g page 205] ([http://www.cambridge.org/ Cambridge University Press\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The olive too they say belongs to this pioneeress, and \u0027\u0027craftspersonship\u0027\u0027, plus many arts and crafts are this inventress’s\", \"priority\":7}]}, \"synonyms\":{}}");

