	add("craftswomanship", "{\"term\":\"craftswomanship\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|craftswoman|ship|lang\u003den}}, on the pattern of \u0027craftsmanship\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The body of skills, techniques, and expertise of (a) feminine craft(s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1934\u0027\u0027: Joseph Kirk Folsom, \u0027The Family: Its Sociology and Social Psychiatry\u0027, [http://books.google.co.uk/books?id\u003dc9wnAAAAYAAJ\u0026amp;q\u003dcraftswomanship\u0026amp;dq\u003dcraftswomanship\u0026amp;lr\u003d\u0026amp;ei\u003dp0GzSJPeL5X8ygTmnsiDBw\u0026amp;pgis\u003d1 p296] (J. Wiley \u0026amp; Sons, Inc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"…were to cease purchasing machinery, labor-saving devices, hired service, ready-made food and clothes, and go back to the old-fashioned \u0027\u0027craftswomanship\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027 Duke L.J. 365 (Duke Law Journal); quoted in\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027: Richard Delgado \u0026amp; Jean Stefancic, \u0027Critical Race Theory: The Cutting Edge\u0027, [http://books.google.co.uk/books?id\u003dHd1MpNYWAaoC\u0026amp;pg\u003dPA275\u0026amp;dq\u003dcraftswomanship\u0026amp;lr\u003d\u0026amp;ei\u003dQn-0SK7KHImUzATMhIX2Bg\u0026amp;sig\u003dACfU3U1Sq-dkuogJL34WitI-aSg5B5vQZ\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"PPA275,M1 page 275] ([http://www.temple.edu/tempress/ Temple University Press\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When will I cherish my hair again, the way my grandmother cherished it, when fascinated by its beauty, with hands carrying centuries-old secrets of adornment and \u0027\u0027craftswomanship\u0027\u0027, she plaited it, twisted it, cornrowed it, finger-curled it, olive-oiled it, on the growing moon cut and shaped it, and wove it like fine strands of gold inlaid with semiprecious stones, coral and ivory, telling with my hair a lost-found story of the people she carried inside her\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027: Alison Findlay, \u0027Playing Spaces in Early Women’s Drama\u0027, [http://books.google.co.uk/books?id\u003dRRUFbT3-ZHEC\u0026amp;pg\u003dPA200\u0026amp;dq\u003dcraftswomanship\u0026amp;lr\u003d\u0026amp;ei\u003djoG0SOXGG5WszATL1eCDBw\u0026amp;sig\u003dACfU3U2YazQqq38dDr9z2CSXYcd77cn9zg p200] ([http://www.cambridge.org/ Cambridge University Press\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Its swift intercutting suggests theatrical \u0027\u0027craftswomanship\u0027\u0027 based on a working knowledge of the effects that could be achieved with shutters and scenery offered by the Theatre Royal\", \"priority\":9}]}, \"synonyms\":{}}");

