	add("craic", "{\"term\":\"craic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"{{borrowing|ga|lang\u003den}}, from English \u0027crack\u0027 in turn from Middle english (1100-1500) \u0027crak\u0027 (loud conversation, bragging talk)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fun, especially through enjoyable company, a pleasant conversation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Kevin Cullen, \u0027His peace in poetry\u0027, The Boston Globe, [http://www.boston.com/news/local/massachusetts/articles/2007/11/19/his_peace_in_poetry\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He nursed bottled water and listened to the accents, the stories, the \u0027\u0027craic\", \"priority\":3}]}, \"synonyms\":{}}");

	add("craig", "{\"term\":\"craig\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"originally meaning someone who lived near a crag\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"transferred from the surname\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027 Bruce Jackson: \u0027The Programmer: A Novel\u0027. Doubleday 1979. page 168\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He told her the name he had used to rent the cabin. \u0026quot; I\u0027m \u0027\u0027Craig\u0027\u0027 Hemsworth.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She burst out laughing. \u0026quot;That\u0027s a funnier name than mine. It sounds like the kind of name they give a movie actor when they decide his own name won\u0027t do\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A river in Alaska and British Columbia\", \"priority\":6}]}, \"synonyms\":{}}");

	add("cramp", "{\"term\":\"cramp\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"Icelandic\", \"Dutch\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027crampe\u0027 from Old french (842-ca. 1400) \u0027crampe\u0027 \u0027cranpe\u0027 (cramp) from Old Frankish {{m|frk|*krampa||cramp}}, from Proto-germanic {{m|gem-pro|*krampō||cramp, clasp}}, from Proto-indo-european {{m|ine-pro|*grem-||to unite; lap, pile, heap}}, from Proto-indo-european {{m|ine-pro|*ger-||to unite, collect, forgather}}. Cognate with Dutch \u0027kramp\u0027 (cramp) German low german \u0027kramp\u0027 (cramp) German \u0027krampe\u0027 and \u0027krampf\u0027 (cramp) Swedish \u0027kramp\u0027 (cramp) Icelandic \u0027krampa\u0027 (cramp) See also Proto-germanic {{m|gem-pro|*kruppaz||lump, round mass, body, crop}}, Ancient Greek \u0027ἀγείρω\u0027 (i gather, collect) whence {{m|grc|ἀγορά}}, Latin \u0027grex\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A painful contraction of a muscle which cannot be controlled\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir T. Mor\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027cramp\u0027\u0027, divers nights, gripeth him in his legs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which confines or contracts; a restraint; a shackle; a hindrance\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"L\u0027Estrang\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A narrow fortune is a \u0027\u0027cramp\u0027\u0027 to a great mind\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Cowpe\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"crippling his pleasures with the \u0027\u0027cramp\u0027\u0027 of fea\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A clamp for carpentry or masonry\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A piece of wood having a curve corresponding to that of the upper part of the instep, on which the upper leather of a boot is stretched to give it the requisite shape\", \"priority\":10}]}, \"synonyms\":{}}");

	add("crampon", "{\"term\":\"crampon\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An attachment to a shoe or boot that provides traction by means of spikes. Used for climbing or walking on slippery surfaces, especially ice\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An aerial rootlet for support in climbing, as of ivy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A heraldic figure in the form of a bar bent at the ends into the form of a hook\", \"priority\":3}]}, \"synonyms\":{}}");

	add("cramps", "{\"term\":\"cramps\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cramping of muscles, especially in the abdomen or uterus\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crane", "{\"term\":\"crane\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027cran\u0027 from Old english (ca. 450-1100) \u0027cran\u0027 (crane) from Proto-germanic {{m|gem-pro|*kranô||crane}}, from Proto-indo-european {{m|ine-pro|*gerh₂-||to cry hoarsely}}. Cognate with Scots \u0027cran\u0027 (crane) Dutch \u0027kraan\u0027 (crane) German \u0027kran\u0027 (crane)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large bird of the order \u0027Gruiformes\u0027 and the family \u0027Gruidae\u0027 having long legs and a long neck which it extends when flying\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ardea herodias\u0027, the great blue heron\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A mechanical lifting machine or device, often used for lifting heavy loads for industrial or construction purposes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An iron arm with horizontal motion, attached to the side or back of a fireplace for supporting kettles etc. over the fire\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A siphon, or bent pipe, for drawing liquors out of a cask\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A forked post or projecting bracket to support spars, etc.; generally used in pairs\", \"priority\":6}]}, \"synonyms\":{}}");

	add("cranapple", "{\"term\":\"cranapple\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|cranberry|apple|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A blend of cranberry and apple\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Mark A. Hinebaugh, \u0027Flying Upside Down: True Tales of an Antarctic Pilot\u0027, page 90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The box lunch always contained enough for a crew of nine: three loaves of bread, a pound of American cheese, a pound of mystery meat (usually something that resembled salami), one jar of smooth peanut butter, one jar of grape jelly, two dozen small bags of airline peanuts (or, occasionally, rock-hard raisins), a dozen boxes of cranberry juice (or \u0027\u0027cranapple\u0027\u0027, crangrape, or the like), condiments, and dessert\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crandall", "{\"term\":\"crandall\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Probably from the name \u0027crandall\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of hammer having a head formed of a group of pointed steel bars, used for dressing ashlar, etc\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cranefly", "{\"term\":\"cranefly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crane|fly|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various large flies of the suborder Tipulomorpha that have slender bodies and very long legs and that resemble giant mosquitoes\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cranesbill", "{\"term\":\"cranesbill\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any flowering plant of the genus \u0027Geranium\u0027 found throughout the temperate zone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A pair of long-beaked forceps\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crangrape", "{\"term\":\"crangrape\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|cranberry|grape|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A blend of cranberry and grape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Mark A. Hinebaugh, \u0027Flying Upside Down: True Tales of an Antarctic Pilot\u0027, page 90\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The box lunch always contained enough for a crew of nine: three loaves of bread, a pound of American cheese, a pound of mystery meat (usually something that resembled salami), one jar of smooth peanut butter, one jar of grape jelly, two dozen small bags of airline peanuts (or, occasionally, rock-hard raisins), a dozen boxes of cranberry juice (or cranapple, \u0027\u0027crangrape\u0027\u0027, or the like), condiments, and dessert\", \"priority\":3}]}, \"synonyms\":{}}");

	add("craniology", "{\"term\":\"craniology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|cranio|logy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the physical characteristics of the human skull\", \"priority\":1}]}, \"synonyms\":{}}");

	add("craniometer", "{\"term\":\"craniometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|cranio|meter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device used to measure the size of the skull\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cranioscopy", "{\"term\":\"cranioscopy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|cranio|scopy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the shape, size, and other features of the human skull\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027, C. G. Carus, \u0026quot;Some Remarks on the Construction of the Upper Jaw of the Skull of a Greenlander,\u0026quot; \u0027Journal of the Anthropological Society of London\u0027, vol. 2, p. cxiv\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the first part of my \u0027Atlas on \u0027\u0027Cranioscopy\u0027\u0027\u0027, which appeared in Leipzig in 1843, I remarked that in the skull of a Greenlander, which I sketched, it was singular, that on this skull there was a decided separation between the upper jaw-bone and the intermaxillary bone, almost as in little children or in quadrupeds\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Phrenology\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, William J. Broad, \u0026quot;Lost in Thought,\u0026quot; \u0027Science News\u0027, vol. 114, no. 22, p. 361\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A theory that was totally wrong helped focus attention on the right questions. Some people called it phrenology. Its founder, Franz Joseph Gall (1758-1828) called it \u0027\u0027cranioscopy\u0027\u0027. . . . It held that the brain had specific areas of function and that mental and moral attributes of a person could be determined by examination of the cranium\", \"priority\":6}]}, \"synonyms\":{}}");

	add("craniosynostosis", "{\"term\":\"craniosynostosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|cranio|synostosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a medical condition in which some or all of the sutures in the skull of an infant close too early, causing problems with normal brain and skull growth\", \"priority\":1}]}, \"synonyms\":{}}");

	add("craniotomy", "{\"term\":\"craniotomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|cranio|tomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The surgical procedure for removing a part of the skull, called a bone flap, prior to a treatment. The bone flap is replaced at the end of the operation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cranium", "{\"term\":\"cranium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{m|la|crānium||skull}}, from Ancient greek (to 1453) \u0027κρανίον\u0027 (skull)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The skull of a vertebrate\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That part of the skull enclosing the brain, the braincase\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crankarm", "{\"term\":\"crankarm\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crank|arm|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the two lever components that attach the bottom bracket spindle to a pedal\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crankiness", "{\"term\":\"crankiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|cranky|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being cranky\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crankle", "{\"term\":\"crankle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a bend, twist or crinkle\", \"priority\":1}]}, \"synonyms\":{}}");

	add("cranks", "{\"term\":\"cranks\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fans\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crankset", "{\"term\":\"crankset\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crank|set|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The component of a bicycle drivetrain that converts the reciprocating motion of the rider\u0027s legs into rotational motion used to drive the chain, which in turn drives the rear wheel\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crape", "{\"term\":\"crape\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Alteration of French \u0027crepe\u0027 () from Middle french (ca. 1400-1600) \u0027crespe|lang\u003dfrm\u0027 () from Latin \u0027crispus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Crepe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Mourning garments, especially an armband or hatband\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crapitalism", "{\"term\":\"crapitalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|crap|capitalism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Corrupt or inauthentic capitalism; capitalism viewed as an inherently flawed or unjust system\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Walli F. Leff \u0026amp; Marilyn G. Haft, \u0027Time Without Work: People Who Are Not Working Tell Their Stories, How They Feel, What They Do, How They Survive\u0027, South End Press (1983), ISBN 0896081850, [http://books.google.com/books?id\u003dR-OU2jIvjCAC\u0026amp;pg\u003dPA346 page 346\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"All you have to do is look around and see that the solution is here; there are better ways to handle the resources of the globe, there are better ways to do things than \u0026quot;\u0027\u0027crapitalism\u0027\u0027.\u0026quot\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crapola", "{\"term\":\"crapola\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crap|ola|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Items or material of poor quality or little importance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My junk drawer is full of all sorts of \u0027\u0027crapola\", \"priority\":2}]}, \"synonyms\":{}}");

	add("crapology", "{\"term\":\"crapology\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crap|ology|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"crap; nonsense; rubbish\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crapper", "{\"term\":\"crapper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A water closet containing a flushable toilet, especially a toilet fixture identified \u0026quot;T. Crapper\u0026quot;, a well known Victorian-era English engineer and plumbing installer, w:Thomas Thomas Crapper\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A flush toilet, a commode\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A privy, an outhouse\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crapplication", "{\"term\":\"crapplication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|crap|application|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unwanted or poor-quality application\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0026quot;William Wueppelmann\u0026quot;, \u0027How to downgrade to Windows 95?? Win 98 HATES my guts.\u0027 (on newsgroup \u0027rec.games.computer.ultima.dragons\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"By contrast, I\u0027ve never seen a Windows machine perform well after being on for more than about 5 or 6 days straight; if it doesn\u0027t outright crash, it loses all of its memory and has to be restarted, PLUS it is susceptible to the same hardware lockups, power failures and \u0027\u0027crapplications\u0027\u0027 as Linux is\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, \u0026quot;n3kkb0\u0026quot;, \u0027Rocksim and WindowsXP\u0027 (on newsgroup \u0027rec.models.rockets\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Most people don\u0027t realize how many background \u0027\u0027crapplications\u0027\u0027 they have running thanks to the different stuff that they have installed\", \"priority\":5}]}, \"synonyms\":{}}");

	add("crapton", "{\"term\":\"crapton\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crap|ton|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very large amount\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crapula", "{\"term\":\"crapula\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin {{m|la|crāpula||intoxication}}, from Ancient greek (to 1453) \u0027κραιπάλη\u0027 (intoxication, hangover)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sickness or indisposition caused by excessive eating or drinking\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crapware", "{\"term\":\"crapware\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crap|ware|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Unwanted software that comes pre-installed with personal computers\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, \u0026quot;Can Apple\u0027s Best Topple the PC Competition?\u0026quot;, \u0027Maximum PC\u0027, Future US, Inc. (ISSN 1522-4279), No. 96, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We suspect that its extra pound of heft is made up entirely of \u0027\u0027crapware\u0027\u0027—the Vaio ships with a ludicrous number of useless preinstalled applications. We understand the economic necessities of subsidizing inexpensive PCs with third-party \u0027\u0027crapware\u0027\u0027, but there\u0027s no excuse for whoring out a notebook of this price\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Eric Griffith, \u0026quot;Make the Most of Your New PC\u0026quot;, \u0027PC Mag\u0027, Ziff Davis Inc. (ISSN 0888-8507), Volume 28, No. 1, page 6\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Big-name system vendors typically install software on their consumer PCs at the factory. These \u0026quot;extras\u0026quot; go by many names: bundleware, begware, bloatware, and my favorite, crapware. That\u0027s because a lot of it is just that: useless crap. A few vendors, like Sony and Dell, offer some options to avoid \u0027\u0027crapware\u0027\u0027, but usually just for small businesses. Boutique manufacturers, like Velocity Micro, do a better job of providing a clean system\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Guy Hart-Davis, \u0027The Healthy PC: Preventive Care, Home Remedies, and Green Computing, 2nd Edition\u0027, McGraw Hill Professional (ISBN 9780071752916\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"All \u0027\u0027crapware\u0027\u0027 programs can be useful—but each program is likely to be useful to only a few of the people the PC manufacturer inflicts it on. The PC manufacturers claim they install \u0027\u0027crapware\u0027\u0027 to provide useful software, but the real reason is that the software companies pay them to include it\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Woody Leonhard, \u0027Windows 8 All-in-One For Dummies\u0027, John Wiley \u0026amp; Sons (ISBN 9781118237991\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I hate it when the computer I want comes loaded with all that nice, “free” \u0027\u0027crapware\u0027\u0027. I\u0027d seriously consider paying more to get a clean computer. You don\u0027t need an antivirus and Internet security program preinstalled on your new PC. lt\u0027ll just open and beg for money next month. Windows 8 comes with Windows Defender, and it works great — for free. Browser toolbars? Puh-lease\", \"priority\":9}]}, \"synonyms\":{}}");

	add("craquelure", "{\"term\":\"craquelure\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The distinctive pattern of hairline cracks in the surface of an old painting\", \"priority\":1}]}, \"synonyms\":{}}");

	add("crasher", "{\"term\":\"crasher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|crash|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who crashes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who attends an event without an invitatio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"w:Wedding Wedding Crashers\u0027 (2005 movie\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crashpad", "{\"term\":\"crashpad\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{wikipedia|crashpad|mul\u003dcrash pad}}{{compound|crash|pad|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the aviation industry, used for a place of temporary lodging for airline flight crews\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any place used for temporary lodging\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A protective foam pad placed on the ground, used as protection in case of falling from the wall\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crasis", "{\"term\":\"crasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κρᾶσις\u0027 (mixture)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One\u0027s constitution; the balance of humours in a person\u0027s body\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I.iii.1.2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some men have peculiar symptoms, according to their temperament and \u0027\u0027\u0027crasis\u0027\u0027\u0027, which they had from the stars and those celestial influences\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1759\u0027\u0027, Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027, Penguin 2003, p. 24\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This is all that ever stagger\u0027d my faith in regard to \u0027Yorick\u0027’s extraction, who, by what I can remember of him, and by all the accounts I could ever get of him, seem\u0027d not to have had one single drop of \u0027Danish\u0027 blood in his whole \u0027\u0027crasis\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A mixture or combination\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The contraction of a vowel or diphthong at the end of a word with a vowel or diphthong at the start of the following word\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1861\u0027\u0027, William Edward Jelf, \u0027Accidence\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"When in a \u0027\u0027crasis\u0027\u0027, a lene consonant is combined with an aspirated vowel, the lene is always changed (except in the Ionic dialect) into the corresponding aspirate\", \"priority\":9}]}, \"synonyms\":{}}");

	add("crate", "{\"term\":\"crate\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"West Frisian\", \"Dutch\", \"old norse\", \"old dutch\"], \"text\":\"From Dutch \u0027krat\u0027 (crate, large box, basket) from Middle dutch (ca. 1050-1350) \u0027cratte\u0027 (basketware, mold) from Old dutch {{m|odt|*kratta}}, {{m|odt|*kratto||basket}}, from Proto-germanic {{m|gem-pro|*kratjô}}, {{m|gem-pro|*krattijô||basket}}, from Proto-indo-european {{m|ine-pro|*gred-}}, {{m|ine-pro|*gre(n)t-||plaiting, wicker, basket, cradle}}, from Proto-indo-european {{m|ine-pro|*ger-||to bind, twist, wind}}. Cognate with West frisian \u0027kret\u0027 (wheelbarrow) German \u0027krätze\u0027 (basket) Old english (ca. 450-1100) \u0027cræt\u0027 \u0027ceart\u0027 (cart, wagon, chariot) Old norse \u0027kartr\u0027 (wagon) More at {{l|en|cart}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large open box or basket, used especially to transport fragile goods\", \"priority\":1}]}, \"synonyms\":{}}");

