	add("cravat", "{\"term\":\"cravat\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\", \"Dutch\", \"Serbo-Croatian\"], \"text\":\"From French \u0027cravate\u0027 an appellative use of \u0027cravate\u0027 from Dutch \u0027krawaat\u0027 from German \u0027krawatte\u0027 from Serbo-croatian {{m|sh|Hr̀vāt}}/{{m|sh|Хр̀ва̄т||Croat}}. See {{m|en|Croat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A wide fabric band worn as a necktie by men, having long ends hanging in front; like an ascot tie\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"It was April 22, 1831, and a young man was walking down Whitehall in the direction of Parliament Street. He wore shepherd\u0027s plaid trousers and the swallow-tail coat of the day, with a figured muslin \u0027\u0027cravat\u0027\u0027 wound about his wide-spread collar\", \"priority\":2}]}, \"synonyms\":{}}");

