	add("crayfish", "{\"term\":\"crayfish\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"middle low german\", \"old high german (ca. 750-1050)\", \"Dutch\"], \"text\":\"Alteration (by folk etymology, influenced by fish) of Middle english (1100-1500) \u0027crevis\u0027 from Old french (842-ca. 1400) \u0027crevice\u0027 {{gloss|\u0026quot;crayfish\u0026quot;; \u0026gt; Modern French: \u0027écrevisse\u0027 }, from Old Frankish {{m|frk|*krebitja||crayfish}}, diminutive of Old Frankish {{m|frk|*krebit||crab}}, from Proto-germanic {{m|gem-pro|*krabitaz||crab, cancer}}, from Proto-indo-european {{m|ine-pro|*grebʰ-}}, {{m|ine-pro|*gerebʰ-||to scratch, crawl}}. Akin to Old high german (ca. 750-1050) \u0027krebiz\u0027 {{gloss|\u0026quot;edible crustacean, crab\u0026quot;; \u0026gt; Modern German \u0027krebs\u0027 (crab) }, Middle low german \u0027krēvet\u0027 (crab) Dutch \u0027kreeft\u0027 (crayfish, lobster) Old english (ca. 450-1100) \u0027crabba\u0027 (crab) More at crab.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of numerous freshwater decapod crustaceans in superfamilies \u0027\u0027 and \u0027\u0027, resembling the related lobster but usually much smaller\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A freshwater crustacean (family \u0027\u0027), sometimes used as an inexpensive seafood or as fish bait\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A rock lobster (family Palinuridae\", \"priority\":3}]}, \"synonyms\":{}}");

	add("crayon", "{\"term\":\"crayon\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027crayon\u0027 (pencil) from \u0027craie\u0027 (chalk) + \u0027-on\u0027 ((diminutive)) from Latin \u0027creta\u0027 (chalk, clay) from \u0027crētus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A stick of colored chalk or wax used for drawing; a colored pencil\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Let no day pass over you without giving some strokes of the pencil or the \u0027\u0027crayon\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A crayon drawing\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, \u0027Littell\u0027s Living Age\u0027 (volume 167, page 187\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"But on the wall hung two fine \u0027\u0027crayons\u0027\u0027, representing Louis XVI. and Marie Antoinette — pictures which she recognized as having hung in the corridor of the Tuileries — and in front of them were burning two candles on a species of rude altar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A pencil of carbon used in producing electric light\", \"priority\":7}]}, \"synonyms\":{}}");

	add("craze", "{\"term\":\"craze\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Danish\", \"English\", \"middle english (1100-1500)\", \"Icelandic\", \"Norwegian\", \"old norse\", \"Swedish\"], \"text\":\"From Middle english (1100-1500) \u0027crasen\u0027 (lang\u003denm) from Old norse {{m|non|*krasa||to shatter}}. Cognate with Danish \u0027krase\u0027 (to crack, crackle) Swedish \u0027krasa\u0027 (to crack, crackle) Norwegian \u0027krasa\u0027 (to shatter, crush) Icelandic \u0027krasa\u0027 (to crackle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Craziness; insanity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A strong habitual desire or fancy; a crotchet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A temporary passion or infatuation, as for same new amusement, pursuit, or fashion; as, the bric-a-brac craze; the aesthetic craze\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A crack in the glaze or enamel caused by exposure of the pottery to great or irregular heat\", \"priority\":4}]}, \"synonyms\":{}}");

	add("crazymaking", "{\"term\":\"crazymaking\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crazy|making|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of psychological attack on somebody by offering contradictory alternatives and criticizing the person for choosing either\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1974\u0027\u0027, George Robert Bach, Herb Goldberg, \u0027Creative Aggression: The Art of Assertive Living\u0027 (page 86\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Crazymaking\u0027\u0027 interactions can occur between parent and child, husband and wife, employer and employee, and among friends. Of course, the most lethal of such interactions are found within the context of the parent-child relationshi\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Loriann Hoff Oberlin, \u0027Surviving Separation and Divorce\u0027 (page 1\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If you\u0027re the one left behind, you might be thrust into a pattern of \u0027\u0027crazymaking\u0027\u0027, or you might find you\u0027re just coming out of one\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Michelle T. Johnson, \u0027Black Out\u0027 (page 68\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Learning the distinction between well placed concern and unfounded \u0027\u0027crazymaking\u0027\u0027 is a life long lesson in developing good instincts and creating solid emotional boundaries\", \"priority\":7}]}, \"synonyms\":{}}");

	add("crazysauce", "{\"term\":\"crazysauce\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|crazy|sauce|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that is bewildering or exciting\", \"priority\":1}]}, \"synonyms\":{}}");

